VALUES ('5410976140122', 'Belgian Chocolat', 'Artisanal Belgian Chocolates CHOCOLATE BELGARELLENO (PRALINE 65%)-INGREDIENTES: Azúcar, avellanas (23%), leche entera en polvo, manteca de cacao, pasta de cacao, emulgente: lecitina de soja, sabor natural vainilla. Componentes de cacao: chocolate 48% min, chocolate con leche 34% min, chocolate blanco 25 % min Materias secas lácticas: chocolate con leche 22% min , chocolate blanco 30% min. Puede contener otros frutos secos y trigo. FILLED BELGIAN CHOCOLATES (PRALINE 65%)-INGREDIENTS: Sugar, hazelnuts (23%), whole milk powder, cocoa butter, cocoa mass, emulsifier:soya lecithin, natural vanilla flavouring, Cocoa solids.chocolate 48%min, milkchocolate 34% min, white chocolate 25% min. Milk solids milk chocolate 22% min, white chocolate 30% min. May contain other tree nuts and wheat. GEVULDE BELGISCHE CHOCOLAATJES (PRALINE 65% ) INGREDIENTEN Suiker, hazelnoten (23% ), volle melkpoeder, cacaoboter, cacaomassa emulgator sojalecithine, natuurljk vanille aroma. Cacaobestanddel enchocolade 48% min. melkchocolade 34% min, witte chocolade 25% min. Droge melkbestanddelen melkchocolade 22 % min, witte chocolade 30% min. Kan andere noten en tarwe bevatten. INL CHOCOLATES BELGAS COM RECHEIO (PRALINE 65 %) INGREDIENTES: Açúcar, avelas (23%), leite em pó gordo, manteiga de cacau, pasta de cacau, emulsionante: lecitina de soja, aroma natural de baunilha. Cacau: 48% min. no chocolate, 34% min. no chocolate de leite, 25% min. no chocolate branco. Extrato de leite: 22% min. no chocolate de leite, 30% min. no chocolate branco.Pode conter outros frutos de cascarijaetrigo.', 'https://static.openfoodfacts.org/images/products/541/097/614/0122/front_en.8.400.jpg', '34', '16', '52', '50', '', '7.6', '0.19', '0.0748031496062992', '', '0');

