cide citrique), épices, morceaux séchés de physalis peruviana, fruits sucrés lyophilisés en poudre (sirop de glucose, framboises, concentré de jus de betterave), arôme naturel de vanille, arôme naturel d\'orange, arôme naturel de citron, arôme naturel de gingembre et autres arômes naturels, arômes naturels, poivre rose, huile butyrique (du lait), colorant naturel (dioxyde de titane). teneur en cacao : chocolat 74 % min., chocolat au lait 31 % min., chocolat blanc 25 % min. matière sèche du lait : chocolat au lait 23 % min., chocolat blanc 29 % min. peut contenir d\'autres fruits à coque.', 'https://static.openfoodfacts.org/images/products/541/097/617/2017/front_fr.10.400.jpg', '34', '19', '48', '46', '', '6.3', '0.15', '0.0590551181102362', '', '0');

